            description:
                "The List Festival is a small, boutique and cultural music and arts festival based at The Yorkshire Scare grounds in Wakefield. From July 29th to 31st 2022, it offers three carefully curated stages of music, a mouthwatering array of street food vendors and plenty of local artists doing live shows, drag queen performances and plenty more!\n\n\nWe are proudly small and independent with a warm and welcoming vibe. Catering towards music and art lovers of all ages with a boutique feel and bespoke look while showcasing diverse sounds in a laid back environment all within one safe area. The festival is proud to be all-inclusive: there is no discrimination to race, colour, creed or sexual orientation making it a real melting pot and a super safe environment where people are free to be themselves.\n\n\nThe festival has three main areas: Sin City that hosts Dottie a 1970s airstream trailer fully kitted out with Master Sounds tech and a TPI sound system. Throughout the day it will provide everything from Balearic to House to Disco with UK favourites Crazy P, former Panorama Bar resident Prosumer, Manchester mainstay James Holroyd, plus more from Nancy Noise, Sally Rogers, Reeshy, Demi Riquisimo, J.Cub and PBR Streetgang. The icing on the cake comes in the form of Mark Farina flying in from Chicago to play his iconic mushroom jazz set!\n\n\nThe Forbidden Forest area is for after dark action in the woods with high end audio and striped back lighting that allows you to dance like nobodys watching. The music reflects the surroundings; darker, deeper with an edge from the likes of Rob Mello, Lil Mark, Sean Johnston, Paramida, and Tristan da Cunha.\n\n\nThe Lucky Cat Cabaret area is new for 2022 and is colourful and flamboyant with an anything goes vibe. Heavy on production, celebrated radio personality JoJo will host drag acts, performances and anything her imagination can conjure during the day. As night falls, think of the spirit of The Paradise Garage with sets from Annabel Fraser, Jamie Bull, Red Laser Records, Apricot Ballroom and Buckley next to many more.\n\n\nTo keep you fuelled, there will be fresh pizza from Cozy P Pizza, boozy eats from Bastards Bistro and plant based world inspired cuisine from Honest Supper Club, with plenty of extra surprises also in store.\n\n\nThe List Festival is a cosy and compact gathering for cultured dancers of all ages. Do not miss.\n\nTICKETS - https://thelistfestival.co.uk",
